import React from 'react';
import "./styles/UserInfoModal.scss";

const MyInfoModal = ( props: any ) => {
    const { open, close, UserID, makeRoom, WinLoseNum} = props;

    return (
        <div className={ open ? 'openModal Modal' : 'Modal' }>
            { open ? (
                <section>
                    <div className="head">
                    	<button className="close" onClick={close}> &times; </button>
					</div>
                    <div className="content">
						<div className="header">
							<div className="name">{UserID}</div>
							<span className="num win-color">W {WinLoseNum.win}</span>
							<span className="num lose-color"> &nbsp;&nbsp; L {WinLoseNum.lose}</span>
						</div>
					</div>
                    <div className="bottom">
						<a className="btn button" href="/Admin" onClick={makeRoom}><b>Admin</b></a>
					</div>
                </section>
            ) : null }
        </div>
    )
}

export default MyInfoModal
